import React from "react";
import "./latestnews.css";

function Latesnews() {
  return (
    <div className="latest-news">
      <div class="jumbotron">
        <div className="container"></div>
        <h1>Hello, world!</h1>
        <p>...</p>
        <p>
          <a class="btn btn-primary btn-lg" href="#" role="button">
            Learn more
          </a>
        </p>
      </div>
    </div>
  );
}

export default Latesnews;
